import React from "react";
import Card from './Card';
import DataArray from "./DataArray";
const Container =({search})=> <>
    <div className="container">
        {
        DataArray.map((current) => <>
        {search === ''?<Card 
            key = {current.id}
            data = {current}
        />:none
        }
        </>)
        }
    </div>
</>;

export default Container;
